"I have come to kill you for the sake of honor. And though you possess none, still you die." {{champion:114}} 

I'm actually quite sweet, but I have a fiery temper that I don't let rise to the surface until it's time to expode. Even then, I'm still calm and collected, as I know whatever I say will come back to bite me. 
I explode from petty things. But my honor is one thing I hold in high esteem. If it is insulted, I will begin to get extremely agitated. 
I like to talk things out with my agitator before things get messy, but if they make the same mistake I am not afraid to and have attacked someone. (Nothing extreme -sweatdrops-)

"Feeding time!"

"Need some grog..."{{champion:79}} 

